import React, {Component} from 'react';
import {navData} from '../../data';

import './reset.css';

class App extends Component {
  state = {
    menuItems: navData
  }

  render(){
    const {menuItems} = this.state
    return (
      <React.Fragment>
          <Nav 
            menuItems={menuItems}/>
      </React.Fragment>
    )
  }
}
export default App;
